import './../styles/ProfileScreen.css';
import Nav from './Nav';

function ProfileScreen() {
  return (
    <div className="profileScreen">
      <Nav />
      <div className="profileScreen-body">
          <h1>Edit Profile</h1>

      </div>
    </div>
  );
}

export default ProfileScreen;
